player: .word 0x2200FF,0x33FFFF,0xFFE5CC
clear: .word 0x99D9EA,0x99D9EA,0x99D9EA
testing: .ascii "testing"
newline: .asciiz "\n"
 
.eqv BASE_ADDRESS 0x10008000
 

.globl main
.text

main:
	jal set_starting_screen
	
start_level:
	jal reset_level1
	jal keypressloop



    
reset_level1:
    addi $sp,$sp, -4
    sw $ra, 0($sp)    
    jal set_level1
    
    la $t1, game_data
    li $t2, 3
    sw $t2, 20($t1)
    
    
    
    la $t1, game_data
    addi $sp,$sp, -4
    li $t0, 1
    sw $t0, 0($sp)
    sw $t0, 0($t1)
    addi,$sp,$sp, -4
    li $t0, 4
    sw $t0, 0($sp)
    sw $t0, 4($t1)
    jal get_x_y
    lw $t0, 0($sp) #pop coord
    addi $sp, $sp, 4
    addi $sp, $sp, -4 
    sw $t0, 0($sp)
    jal load_character
    
    la $t1, enemy_data
    addi $sp,$sp, -4
    li $t0, 1
    sw $t0, 0($sp)
    sw $t0, 0($t1)
    addi,$sp,$sp, -4
    li $t0, 26
    sw $t0, 0($sp)
    sw $t0, 4($t1)
    jal get_x_y
    lw $t0, 0($sp) #pop coord
    addi $sp, $sp, 4
    addi $sp, $sp, -4 
    sw $t0, 0($sp)
    jal load_creeper
    
    
    la $t1, enemy_data
    addi $sp,$sp, -4
    li $t0, 60
    sw $t0, 0($sp)
    sw $t0, 12($t1)
    addi,$sp,$sp, -4
    li $t0, 4
    sw $t0, 0($sp)
    sw $t0, 16($t1)
    jal get_x_y
    lw $t0, 0($sp) #pop coord
    addi $sp, $sp, 4
    addi $sp, $sp, -4 
    sw $t0, 0($sp)
    jal load_creeper
    
    la $t1, enemy_data
    addi $sp,$sp, -4
    li $t0, 60
    sw $t0, 0($sp)
    sw $t0, 24($t1)
    addi,$sp,$sp, -4
    li $t0, 42
    sw $t0, 0($sp)
    sw $t0, 28($t1)
    jal get_x_y
    lw $t0, 0($sp) #pop coord
    addi $sp, $sp, 4
    addi $sp, $sp, -4 
    sw $t0, 0($sp)
    jal load_arrow
    lw $ra, 0($sp) 
    addi $sp,$sp, 4
    jr $ra
    
    
    
    
keypressloop:
    li $v0, 32	# sleep
    li $a0, 65
    syscall
    jal check_death_screen
    jal move_creeper1
    jal move_creeper2
    jal move_arrow
    jal check_enemy_touch
    jal check_damage
    jal check_health
    la $a0, game_data
    lw $a1, 24($a0)
    bnez $a1, keypressloop
    jal process_gravity
    jal process_jump
    li $t9, 0xffff0000     # Load base address for keyboard MMIO
    
    # Check for keystroke event
    lw $t8, 0($t9)         # Load the value from the memory-mapped I/O
    beq $t8, 0, keypressloop       # Loop back if no key pressed
    
    # Load ASCII value of key pressed
    lw $t2, 4($t9)         # Load the ASCII value of the key pressed

    # Check for 'W' keypress
    li $t3, 0x77           # ASCII value for 'W'
    beq $t2, $t3, respond_to_w
    
    # Check for 'A' keypress
    li $t3, 0x61           # ASCII value for 'A'
    beq $t2, $t3, respond_to_a
    
    
    # Check for 'D' keypress
    li $t3, 0x64           # ASCII value for 'D'
    beq $t2, $t3, respond_to_d
    
   
    
    # Check for 'Q' keypress
    li $t3, 0x71           # ASCII value for 'S'
    beq $t2, $t3, respond_to_q
    
    # Check for 'R' keypress
    li $t3, 0x72           # ASCII value for 'S'
    beq $t2, $t3, respond_to_r
    

    j keypressloop                # Jump back to main to check for next keypress


action_keypressloop:

    li $t9, 0xffff0000     # Load base address for keyboard MMIO
    
    # Check for keystroke event
    lw $t8, 0($t9)         # Load the value from the memory-mapped I/O
    beq $t8, 0, action_keypressloop       # Loop back if no key pressed
    
    # Load ASCII value of key pressed
    lw $t2, 4($t9)         # Load the ASCII value of the key pressed

 
   
    
    # Check for 'Q' keypress
    li $t3, 0x71           # ASCII value for 'S'
    beq $t2, $t3, respond_to_q
    
    # Check for 'R' keypress
    li $t3, 0x72           # ASCII value for 'S'
    beq $t2, $t3, respond_to_r
    

    j action_keypressloop                # Jump back to main to check for next keypress
    
respond_to_w:
  
    la $t2, game_data
    lw $t0, 0($t2)
    lw $t1, 4($t2)
    addi $t1, $t1, 3
    addi $sp,$sp, -4
    sw $t0, 0($sp)
    addi $sp,$sp, -4
    sw $t1, 0($sp)
    jal get_x_y
    lw $t0, 0($sp) #pop coord
    addi $sp, $sp, 4
    addi $sp, $sp, -4
    sw $t0, 0($sp)
 
    jal check_collision
    lw $t0, 0($sp) #pop coord
    addi $sp, $sp, 4
    
    
    bnez $t0, keypressloop
    la $t2, game_data
    li $t1, 1
    lw $t3, 8($t2)
    beq $t1, $t3, keypressloop
    sw $t1, 8($t2)
    sw $zero, 16($t2)
    
   
    # Your code to respond to 'W' keypress
    j keypressloop

respond_to_a:
    la $t2, game_data
    lw $t0, 0($t2)
    lw $t1, 4($t2)
    
    beqz $t0,  keypressloop
