starting_keypressloop:

    li $t9, 0xffff0000     # Load base address for keyboard MMIO
    
    # Check for keystroke event
    lw $t8, 0($t9)         # Load the value from the memory-mapped I/O
    beq $t8, 0, starting_keypressloop       # Loop back if no key pressed
    
    # Load ASCII value of key pressed
    lw $t2, 4($t9)         # Load the ASCII value of the key pressed

    # Check for 'W' keypress
    li $t3, 0x77           # ASCII value for 'W'
    beq $t2, $t3, start_respond_to_w
    
    # Check for 'A' keypress
    li $t3, 0x73           # ASCII value for 'A'
    beq $t2, $t3, start_respond_to_s
   
    
    # Check for 'Q' keypress
    li $t3, 0x71           # ASCII value for 'S'
    beq $t2, $t3, respond_to_q
    
    # Check for 'R' keypress
    li $t3, 0x72           # ASCII value for 'S'
    beq $t2, $t3, respond_to_r
    

    j starting_keypressloop                # Jump back to main to check for next keypress

